import { TodoListData } from "../pages/todoPage";

export default function ToDo({props}: {props: TodoListData}) {
    const {id, todo, isCompleted, userId} = props

    return (
        <li>
            <label>
                <input type="checkbox" checked />
                <span>{todo}</span>
            </label>
        </li>
    )
}
